import React from 'react';
import "./home.css"
const data = [
  {
    image: "./images/1.jpg",
    title: "Noah's Ark"
  },
  {
    image: "../images/3.jpg",
    title: "Noah's Ark"
  },
  {
    image: "../images/4.jpg",
    title: "Bible"
  },
  {
    image: "../images/5.jpg",
    title: "Christian"
  },
  {
    image: "../images/6.jpg",
    title: "Pray"
  }
];

function Home() {
  return (
    <div className='h-screen bg-slate-600 pt-10'>
      <div className='h'>
        {
          data.map((item, index) => (
            <div key={index} className='mb-4'>
              <img src={item.image} alt={item.title} className='w-40 ' />
              <div className='p-6'>
                <p className='font-semibold'>{item.title}</p>
              </div>
            </div>
          ))
        }
      </div>
    </div>
  );
}

export default Home;
